import Container from 'react-bootstrap/Form';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/Form';
import 'bootstrap/dist/css/bootstrap.min.css';

var jack = ["hello", "hello"]
function App(){

  const [backendData, setBackendData] = useState([])

  useEffect(() => {
    fetch("/api")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setBackendData(data)
      })
  }, [])

  return (
    <div className='App'>
      <Container>
        <h1 className='text-center mt-4'>Powerlifting Meets</h1>
        <Form>
          <InputGroup className='my-3'>
            <Form.Control placeholder="filter events"/>
          </InputGroup>
        </Form>
        <Table>
          <thead>
            <th>
              <th>Name</th>
              <th>Event Details</th>
              <th>When</th>
              <th>Where</th>
            </th>
          </thead>
          <tbody>
            <tr>

            </tr>
          </tbody>
        </Table>
      </Container>
    </div>
  )
}


export default App
